com/en/coins/primecoin\\\">Primecoin</a>,andsoon.\\r\\n\\r\\nThecryptocurrencythentookoffwiththeinnovationoftheturing-completesmartcontractby<ahref=\\\"https://www.coingecko.com/en/coins/ethereum\\\">Ethereum</a>whichledtothedevelopmentofotheramazingprojectssuchas<ahref=\\\"https://www.coingecko.com/en/coins/eos\\\">EOS</a>,<ahref=\\\"https://www.coingecko.com/en/coins/tron\\\">Tron</a>,andevencrypto-collectiblessuchas<ahref=\\\"https://www.coingecko.com/buzz/ethereum-still-king-dapps-cryptokitties-need-1-billion-on-eos\\\">CryptoKitties</a>.\",\"vi\":\"\",\"tr\":\"\",\"ru\":\"\",\"ja\":\"\",\"zh\":\"\",\"zh-tw\":\"\",\"ko\":\"비트코인은2009년나카모토사토시가만든디지털통화로,통화를발행하고관리하는중앙장치가존재하지않는구조를가지고있다.대신,비트코인의거래는P2P기반분산데이터베이스에의해이루어지며,공개키암호방식기반으로거래를수행한다.비트코인은공개성을가지고있다.비트코인은지갑파일의형태로저장되며,이지갑에는각각의고유주소가부여되며,그주소를기반으로비트코인의거래가이루어진다.비트코인은1998년웨이따이가사이버펑크메일링리스트에올린암호통화란구상을최초로구현한것중의하나이다.\\r\\n\\r\\n비트코인은최초로구현된가상화폐입니다.발행및유통을관리하는중앙권력이나중간상인없이,P2P네트워크기술을이용하여네트워크에참여하는사용자들이주체적으로화폐를발행하고이체내용을공동으로관리합니다.이를가능하게한블록체인기술을처음으로코인에도입한것이바로비트코인입니다.\\r\\n\\r\\n비트코인을사용하는개인과사업자의수는꾸준히증가하고있으며,여기에는식당,아파트,법률사무소,온라인서비스를비롯한소매상들이포함됩니다.비트코인은새로운사회현상이지만아주빠르게성장하고있습니다.이를바탕으로가치증대는물론,매일수백만달러의비트코인이교환되고있습니다.\\r\\n\\r\\n비트코인은가상화폐시장에서현재유통시가총액과코인의가치가가장크고,거래량또한안정적입니다.이더리움이빠르게추격하고있지만아직은가장견고한가상화폐라고볼수있습니다.\\r\\n\\r\\n코인특징\\r\\n1.중앙주체없이사용자들에의해거래내용이관리될수있는비트코인의운영시스템은블록체인기술에서기인합니다.블록체인은쉽게말해다같이장부를공유하고,항상서로의컴퓨터에있는장부파일을비교함으로써같은내용만인정하는방식으로운영됩니다.따라서전통적인금융기관에서장부에대한접근을튼튼하게방어하던것과는정반대의작업을통해보안을달성합니다.장부를해킹하려면51%의장부를동시에조작해야하는데,이는사실상불가능합니다.왜냐하면,이를실행하기위해서는컴퓨팅파워가어마어마하게소요되고,이것이가능한슈퍼컴퓨터는세상에존재하지않기때문입니다.또한,장부의자료들은줄글로기록되는것이아니라암호화해시함수형태로블록에저장되고,이블록들은서로연결되어있어서더강력한보안을제공합니다.\\r\\n\\r\\n2.비트코인은블록발행보상을채굴자에게지급하는방식으로신규코인을발행합니다.블록발행보상은매21만블록(약4년)을기준으로발행량이절반으로줄어듭니다.처음에는50비트코인씩발행이되었고,4년마다계속반으로감소하고있습니다.코인의총량이2,100만개에도달하면신규발행은종료되고,이후에는거래수수료만을통해시스템이지탱될것입니다.\\r\\n\\r\\n핵심가치\\r\\n(키워드:통화로사용될수있는보편성및편의성)\\r\\n\\r\\n1.다양한알트코인들의등장에앞서비트코인은가상화폐시장에서독보적이었기때문에,현재가장보편적인결제수단으로사용됩니다.실생활에서이를활용할수있는가맹점이알트코인들보다압도적으로많을뿐만아니라,이또한증가하고있습니다.일례로일본업체들이비트코인결제시스템을도입하면서곧비트코인을오프라인점포26만곳에서이용할수있게될것입니다.\\r\\n\\r\\n2.여러나라에서비트코인을정식결제수단으로인정하면서,실물화폐와가상화폐를거래할때더는부가가치세가부과되지않게된다고합니다.실제로일본과호주에서는이미비트코인을합법적결제수단으로인정하면서제도권안으로들여오고있고,미국에서는비트코인ETF승인노력도진행되고있습니다.각국에비트코인을기반으로한ATM기계도설치되었다고합니다.\",\"ar\":\"\",\"th\":\"\",\"id\":\"\",\"cs\":\"Bitcoinisthefirstsuccessfulinternetmoneybasedonpeer-to-peertechnology;wherebynocentralbankorauthorityisinvolvedinthetransactionandproductionoftheBitcoincurrency.Itwascreatedbyananonymousindividual/groupunderthename,SatoshiNakamoto.Thesourcecodeisavailablepubliclyasanopensourceproject,anybodycanlookatitandbepartofthedevelopmentalprocess.\\r\\n\\r\\nBitcoinischangingthewayweseemoneyaswespeak.Theideawastoproduceameansofexchange,independentofanycentralauthority,thatcouldbetransferredelectronicallyinasecure,verifiableandimmutableway.Itisadecentralizedpeer-to-peerinternetcurrencymakingmobilepaymenteasy,verylowtransactionfees,protectsyouridentity,anditworksanywhereallthetimewithnocentralauthorityandbanks.\\r\\n\\r\\nBitcoinisdesignedtohaveonly21millionBTCevercreated,thusmakingitadeflationarycurrency.Bitcoinusesthe<ahref=\\\"https://www.coingecko.com/en?hashing_algorithm=SHA-256\\\">SHA-256</a>hashingalgorithmwithanaveragetransactionconfirmationtimeof10minutes.MinerstodayareminingBitcoinusingASICchipdedicatedtoonlyminingBitcoin,andthehashratehasshotuptopetahashes.\\r\\n\\r\\nBeingthefirstsuccessfulonlinecryptographycurrency,Bitcoinhasinspiredotheralternativecurrenciessuchas<ahref=\\\"https://www.coingecko.com/en/coins/litecoin\\\">Litecoin</a>,<ahref=\\\"https://www.coingecko.com/en/coins/peercoin\\\">Peercoin</a>,<ahref=\\\"https://www.coingecko.com/en/coins/primecoin\\\">Primecoin</a>,andsoon.\\r\\n\\r\\nThecryptocurrencythentookoffwiththeinnovationoftheturing-completesmartcontractby<ahref=\\\"https://www.coingecko.com/en/coins/ethereum\\\">Ethereum</a>whichledtothedevelopmentofotheramazingprojectssuchas<ahref=\\\"https://www.coingecko.com/en/coins/eos\\\">EOS</a>,<ahref=\\\"https://www.coingecko.com/en/coins/tron\\\">Tron</a>,andevencrypto-collectiblessuchas<a